(window.webpackJsonp=window.webpackJsonp||[]).push([[387],{696:function(n,e){n.exports="Tree 树形控件\n===\n\n使用树控件可以完整展现其中的层级关系，并具有展开收起选择等交互功能。\n\n```jsx\nimport { Tree } from 'uiw';\n```\n\n### 基础用法\n\n\x3c!--DemoStart,bgWhite,codePen--\x3e \n```js\nimport { Tree, Card } from 'uiw';\n\nconst data = [\n  {\n    label: '湖北省',\n    key: '0-0-0',\n    children:[\n      {\n        label: '武汉市',\n        key: '0-1-0',\n        children:[\n          { label: '新洲区', key: '0-1-1' },\n          { label: '武昌区', key: '0-1-2' },\n          {\n            label: '汉南区',\n            key: '0-1-3',\n            children:[\n              { label: '汉南区1', key: '0-1-3-1' },\n              { label: '汉南区2', key: '0-1-3-2' },\n              { label: '汉南区3', key: '0-1-3-3' },\n            ]\n          },\n        ]\n      },\n      { label: '黄冈市', key: '0-2-0' },\n      {\n        label: '黄石市',\n        key: '0-3-0',\n        children:[\n          { label: '青山区', key: '0-3-1' },\n          { label: '黄陂区', key: '0-3-2' },\n          { label: '青山区', key: '0-3-3' },\n        ]\n      },\n    ]\n  },\n  {\n    label: '上海市',\n    key: '1-0-0',\n    children:[\n      { label: '黄浦区', key: '1-0-1' },\n      { label: '卢湾区', key: '1-0-2' },\n      {\n        label: '徐汇区',\n        key: '1-0-3',\n        children:[\n          { label: '半淞园路街道', key: '1-1-0' },\n          { label: '南京东路街道', key: '1-2-0' },\n          { label: '外滩街道', key: '1-3-0' },\n        ]\n      },\n    ]\n  },\n  {\n    label: '北京市',\n    key: '2-0-0',\n    children:[\n      { label: '东城区', key: '2-1-0' },\n      { label: '西城区', key: '2-2-0' },\n      {\n        label: '崇文区',\n        key: '2-3-0',\n        children:[\n          { label: '东花市街道', key: '2-3-1' },\n          { label: '体育馆路街道', key: '2-3-2' },\n          { label: '前门街道', key: '2-3-3' },\n        ]\n      },\n    ]\n  }\n];\n\nconst Demo = () => (\n  <div>\n    <Row gutter={10}>\n      <Col fixed>\n        <Card title=\"单选\">\n          <Tree\n            defaultExpandAll\n            data={data}\n            onExpand={(key, expanded, data, node) => {\n              console.log(key, expanded, data, node);\n            }}\n            onSelected={(key, selected, item, evn) => {\n              console.log(key, selected, item, evn);\n            }}\n          />\n        </Card>\n      </Col>\n      <Col fixed>\n        <Card title=\"多选，子节点不受控\">\n          <Tree\n            defaultExpandAll\n            data={data}\n            multiple\n            onExpand={(key, expanded, data, node) => {\n              console.log(key, expanded, data, node);\n            }}\n            onSelected={(key, selected, item, evn) => {\n              console.log(key, selected, item, evn);\n            }}\n          />\n        </Card>\n      </Col>\n      <Col fixed>\n        <Card title=\"多选，子节点受控\">\n          <Tree\n            defaultExpandAll\n            data={data}\n            multiple\n            checkStrictly\n            onExpand={(key, expanded, data, node) => {\n              console.log(key, expanded, data, node);\n            }}\n            onSelected={(key, selected, item, evn) => {\n              console.log(key, selected, item, evn);\n            }}\n          />\n        </Card>\n      </Col>\n    </Row>\n  </div>\n)\nReactDOM.render(<Demo />, _mount_);\n```\n\x3c!--End--\x3e\n\n\n## Props\n\n| 参数 | 说明 | 类型 | 默认值 |\n|--------- |-------- |--------- |-------- |\n| autoExpandParent | 是否自动展开父节点 | Boolean | true |\n| defaultExpandAll | 默认展开所有树节点 | Boolean | false |\n| checkStrictly | 在 multiple 可选多个节点的情况下，设置 `checkStrictly=true`，所有子节点将被选中。 | Boolean | false |\n| multiple | 支持点选多个节点 | Boolean | false |\n| onSelected | 点击选择树节点触发 | Function(keys,data,e) | - |\n| onExpand | 展开/收起节点时触发 | Function(key,expanded:bool,data,node) | - |\n"}}]);